#include <stdio.h>
#include <stdlib.h>

#define N 55
#define M 55

int n, m;
int a[M], b[M];
int low[N], disc[N], vis[N];
int timer;
int cnt;

void dfs(int u, int p) {
    disc[u] = low[u] = ++timer;
    vis[u] = 1;
    int i;
    for (i = 0; i < m; i++) {
        if (a[i] == u && b[i] == p) continue;
        if (a[i] == u) {
            if (disc[b[i]] == 0) {
                dfs(b[i], u);
                low[u] = (low[u] < low[b[i]]) ? low[u] : low[b[i]];
            } else {
                low[u] = (low[u] < disc[b[i]]) ? low[u] : disc[b[i]];
            }
        }
    }
}

int main() {
    int i, j;
    scanf("%d %d", &n, &m);
    for (i = 0; i < m; i++) {
        scanf("%d %d", &a[i], &b[i]);
        a[i]--; b[i]--;
    }
    for (i = 0; i < n; i++) {
        if (disc[i] == 0) {
            dfs(i, -1);
        }
    }
    for (i = 0; i < m; i++) {
        if (a[i] == b[i]) continue;
        if (disc[a[i]] == 0 || disc[b[i]] == 0) {
            cnt++;
        } else if (low[a[i]] == disc[b[i]]) {
            cnt++;
        }
    }
    printf("%d\n", cnt);
    return 0;
}
